import React from 'react';

const Home = ({term, setTerm}) =>{
    return (
        <div>
            Enter a City: <input type="text" value={term} onChange={()=> setTerm(e.target.value)} />
            <input type="button" value="Search" onClick ={()=> setTerm(term)}/>
        </div>
    )
}

export default Home;
